pragma solidity >=0.8.0 <0.9.0;
import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import "@openzeppelin/contracts/utils/Counters.sol";
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";
import "@chainlink/contracts/src/v0.8/interfaces/KeeperCompatibleInterface.sol";

library BingoGenerate {
    using SafeMath for uint256;

    // Card
    struct Card {
        uint256[5] B;
        uint256[5] I;
        uint256[5] N;
        uint256[5] G;
        uint256[5] O;
    }

    // Settings
    uint256 constant maxCount = 15;

    function generateBingoCard(uint256 randomness) internal pure returns (Card memory card) {
        if(randomness == 0) {
            return card;
        }
        uint256[5] memory col;
        uint256 i;

        for(uint256 k=0; k<5; k++) {
            col = generateColumn(uint256(keccak256(abi.encode(randomness, k))));
            for(i=0;i<5;i++) {
                if(k==2 && i==2) {
                    col[i] = 99;
                } else {
                    col[i] = col[i] + (k*maxCount);
                }
            }

            // Not sure how to do this better :)
            if(k == 0) {
                card.B = col;
            } else if(k == 1) {
                card.I = col;
            } else if(k == 2) {
                card.N = col;
            } else if(k == 3) {
                card.G = col;
            } else if(k == 4) {
                card.O = col;
            }
        }

        return card;
    }

    function generateColumn(uint256 randomness) internal pure returns(uint256[5] memory col) {
        uint256[15] memory possible;
        for(uint256 i=0; i<15; i++) {
            possible[i] = i+1;
        }
        uint256 idx;
        for(uint256 k=0; k<5; k++) {
            idx = uint256(keccak256(abi.encode(randomness, k))).mod(maxCount-(1+k));
            col[k] = possible[idx];
            if(idx != 15 - (1+k)) {
                possible[idx] = possible[15 - (1+k)];
            }
        }
        return col;
    }
}

// Welcome to BINGO
contract Bingo is ERC721, VRFConsumerBase, KeeperCompatibleInterface {
    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    Counters.Counter public gameId;

    // Settings
    string public baseUri;
    uint256 public minCardsPerGame = 1;     // 10
    uint256 public maxCardsPerGame = 1000;
    uint256 public maxCardPurchase = 10;
    uint256 public pricePerCard = 10000000000000000; // 0.01 ETH
    uint256 public ballDrawTime = 60;   // 86400
    uint256 public weedPerCard = 4000 * 1e18; // 4000 Weed
    address weedContract;
    address owner;

    // Game
    uint256 public lastBallTime;
    bytes32 public ballRequest;
    uint256 public prizePool;

    // Random
    bytes32 internal keyHash;
    uint256 internal fee;

    // Mappings
    mapping (bytes32 => uint256) public cardRequests;
    mapping (uint256 => uint256) public cardRandomness;
    mapping (uint256 => uint256) public gameFloors;
    mapping (uint256 => bool) public Balls;

    event BallPicked(uint256 game, uint256 choice);
    event BingoWinner(address winner, uint256 tokenId);

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    constructor(address _weedContract)
    ERC721("Bingo", "BINGO")
    VRFConsumerBase(
        0xdD3782915140c8f3b190B5D67eAc6dc5760C46E9, // VRF Coordinator - Kovan
        0xa36085F69e2889c224210F603D836748e7dC0088  // LINK Token - Kovan
    )
    {
        owner = msg.sender;
        weedContract = _weedContract;
        keyHash = 0x6c3699283bda56ad74f6b855546325b68d482e983852a7a82979cc4807b641f4;
        fee = 0.1 * 10 ** 18; // 0.1 LINK (Varies by network)

        // Automatically start the first game
        gameId.increment();
        lastBallTime = block.timestamp;
        gameFloors[gameId.current()] = _tokenIds.current();
    }

    /*
    *   Purchase.
    */
    function mintCardEth(uint256 amount) public payable {
        require(amount <= maxCardPurchase, "Exceeds Purchase");
        require((_tokenIds.current().add(amount) - gameFloors[gameId.current()]) <= maxCardsPerGame, "Exceeds Game");
        require(pricePerCard.mul(amount) <= msg.value, "Wrong price");
        for(uint256 i=0; i<amount; i++) {
            _tokenIds.increment();
            _safeMint(msg.sender, _tokenIds.current());
            requestRandomCard(_tokenIds.current());
        }
        prizePool += msg.value / 2;
    }

    function mintCardWeed(uint256 amount) public payable {
        require(amount <= maxCardPurchase, "Exceeds Purchase");
        require((_tokenIds.current().add(amount) - gameFloors[gameId.current()]) <= maxCardsPerGame, "Exceeds Game");
        require(IERC20(weedContract).balanceOf(msg.sender) >= weedPerCard * amount, "No Balance");
        require(IERC20(weedContract).allowance(msg.sender, address(this)) >= weedPerCard * amount, "No Permission");
        IERC20(weedContract).transferFrom(msg.sender, address(this), weedPerCard * amount);
        for(uint256 i=0; i<amount; i++) {
            _tokenIds.increment();
            _safeMint(msg.sender, _tokenIds.current());
            requestRandomCard(_tokenIds.current());
        }
    }

    /*
    *   Randomness.
    */

    function checkUpkeep(bytes calldata checkData) external view override returns (bool upkeepNeeded, bytes memory performData) {
        upkeepNeeded = (_tokenIds.current() - gameFloors[gameId.current()] >= minCardsPerGame) && (block.timestamp > lastBallTime+ballDrawTime);
        performData = checkData;
    }

    function performUpkeep(bytes calldata performData) external override {
        require(block.timestamp > lastBallTime+ballDrawTime, "Min Time");
        require((_tokenIds.current() - gameFloors[gameId.current()]) >= minCardsPerGame, "Min Players");

        lastBallTime = block.timestamp;
        requestRandomBall();
        performData;
    }

    function requestRandomCard(uint256 cardId) internal {
        require(LINK.balanceOf(address(this)) >= fee, "Not enough LINK");
        bytes32 requestId = requestRandomness(keyHash, fee);
        cardRequests[requestId] = cardId;
    }

    function requestRandomBall() internal {
        require(LINK.balanceOf(address(this)) >= fee, "Not enough LINK");
        ballRequest = requestRandomness(keyHash, fee);
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        if(requestId == ballRequest) {
            fulfillRandomBall(requestId, randomness);
        } else {
            fulfillRandomCard(requestId, randomness);
        }
    }

    function fulfillRandomCard(bytes32 requestId, uint256 randomness) internal {
        require(cardRequests[requestId] > 0, "NA");
        uint256 cardId = cardRequests[requestId];
        cardRandomness[cardId] = randomness;
        cardRequests[requestId] = 0;
    }

    function fulfillRandomBall(bytes32 requestId, uint256 randomness) internal {
        require(requestId == ballRequest, "Invalid Request");
        uint256 choice;
        bool found;
        uint256 idx = 1;
        while(found == false) {
            choice = randomness.add(idx).mod(BingoGenerate.maxCount*5).add(1);
            if(Balls[choice] == false) {
                Balls[choice] = true;
                found = true;
            } else {
                idx++;
            }
        }
        emit BallPicked(gameId.current(), choice);
    }

    /*
    *   Claim.
    */

    function validateWinner(uint256 cardId) public view returns (bool found) {
        BingoGenerate.Card memory card = BingoGenerate.generateBingoCard(cardRandomness[cardId]);
        uint256[5][12] memory lines;
        uint256 i;
        for(i=0; i<5; i++) {
            lines[i] = [card.B[i], card.I[i], card.N[i], card.G[i], card.O[i]];
        }
        lines[5] = uint256[5](card.B);
        lines[6] = card.I;
        lines[7] = card.N;
        lines[8] = card.G;
        lines[9] = card.O;
        lines[10] = [card.B[0], card.I[1], card.N[2], card.G[3], card.O[4]];
        lines[11] = [card.B[4], card.I[3], card.N[2], card.G[1], card.O[0]];

        found = false;
        uint256 k;
        uint256 matches;
        for(i=0; i<12; i++) {
            matches=0;
            for(k=0; k<5; k++) {
                if(Balls[lines[i][k]] || lines[i][k] == 99) {
                    matches++;
                }
            }
            if(matches == 5) {
                found = true;
            }
        }
    }

    function claimBingo(uint256 cardId) public payable {
        require(ownerOf(cardId) == msg.sender, "Not Owner");
        require(validateWinner(cardId), "Not Winner");
        require(cardId > gameFloors[gameId.current()], "Not current");

        payable(msg.sender).transfer(prizePool);
        emit BingoWinner(msg.sender, cardId);

        // Reset game
        prizePool = 0;
        gameId.increment();
        lastBallTime = block.timestamp;
        gameFloors[gameId.current()] = _tokenIds.current();
        for(uint256 i=1; i<76; i++) {
            if(Balls[i]) {
                Balls[i] = false;
            }
        }
    }

    /*
    *   Getters.
    */

    function generateCard(uint256 cardId) public view returns (BingoGenerate.Card memory) {
        return BingoGenerate.generateBingoCard(cardRandomness[cardId]);
    }

    function getCurrentGame() public view returns (uint256) {
        return gameId.current();
    }

    function getCurrentToken() public view returns (uint256) {
        return _tokenIds.current();
    }

    function getCardsByOwner(address _owner) view public returns(uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 totalTokens = _tokenIds.current();
            uint256 resultIndex = 0;
            for (uint256 t = 1; t <= totalTokens; t++) {
                if (_exists(t) && ownerOf(t) == _owner) {
                    result[resultIndex] = t;
                    resultIndex++;
                }
            }
            return result;
        }
    }

    function exists(uint256 tokenId) public view returns(bool) {
        return _exists(tokenId);
    }

    function _baseURI() internal view override returns (string memory) {
        return baseUri;
    }

    /*
    *   Setters.
    */

    function contractSettings(string memory _baseUri, uint256 _ballDrawTime, uint256 _minCardsPerGame, uint256 _maxCardsPerGame, uint256 _pricePerCard) public onlyOwner {
        baseUri = _baseUri;
        ballDrawTime = _ballDrawTime;
        minCardsPerGame = _minCardsPerGame;
        maxCardsPerGame = _maxCardsPerGame;
        pricePerCard = _pricePerCard;
    }

    /*
    *   Money management.
    */
    function withdraw() public payable onlyOwner {
        uint256 _each = address(this).balance.sub(prizePool).div(3);
        require(payable(0x00796e910Bd0228ddF4cd79e3f353871a61C351C).send(_each));   // sara
        require(payable(0x7fc55376D5A29e0Ee86C18C81bb2fC8F9f490E50).send(_each));   // shaun
        require(payable(0xB58Fb5372e9Aa0C86c3B281179c05Af3bB7a181b).send(_each));   // mark
    }
}
